use crate::Solution;

#[test]
fn run_all_cases() {
    for &(s, words, exp) in CASES {
        let mut exp = exp.to_vec();
        exp.sort_unstable();
        let words = words.into_iter().copied().map(ToOwned::to_owned).collect();
        let s = s.to_owned();

        let mut act = Solution::find_substring(s, words);
        act.sort_unstable();

        assert_eq!(exp, act);
    }
}

